other factors play a part in the bands.\n\n* BMI: the majority of high charges belong to obsese group (BMI 30 and above).\n\n* Children: surprisingly, the more children you have, the lower your medical charges in general!\n\nLet's investigate these further afterwards. How about the quantitative data?\n\n## Relationships of qualitative data against charges:","metadata":{}},{"cell_type":"code","source":"smoker_df <- df %>% mutate(smoker = ifelse(smoker == \"no\", \"non-smoker\", \"smoker\"))\n\ncharges <- smoker_df$charges\nsex <- smoker_df$sex\nsmoker <- smoker_df$smoker\nregion <- smoker_df$region\n\nboxplot(charges ~ sex, main = 'Charges VS Sex', col = c(\"pink\", \"light blue\"))\nboxplot(charges ~ smoker, main = 'Charges VS Smoking Status', col = c(\"steelblue1\", \"salmon1\"))\nboxplot(charges ~ region, main = 'Charges VS Region', col = c(\"thistle2\", \"rosybrown2\", \"bisque\", \"lightgoldenrod\"))","metadata":{"execution":{"iopub.status.busy":"2024-07-12T10:53:14.751748Z","iopub.execute_input":"2024-07-12T10:53:14.753521Z","iopub.status.idle":"2024-07-12T10:53:15.290403Z"},"trusted":true},"execution_count":4,"outputs":[{"output_type":"display_data","data":{"image/png":"iVBORw0KGgoAAAANSUhEUgAAA0gAAANICAIAAAByhViMAAAABmJLR0QA/wD/AP+gvaeTAAAg\nAElEQVR4nOzdZ1wUV9sG8DNb6R0ErKARMGg0ogJGEVGxYE0ENcESMHaJYowlCWoSu0nsmtgI\nNvBRwILBaBAxYI0tCirNRpMeYFm2zPthcEVEpPgyO8v1/5DfcuYw3G4ULs7MmZuiaZoAAAAA\nAPfx2C4AAAAAAN4NBDsAAAAADYFgBwAAAKAhEOwAAAAANASCHQAAAICGQLADAAAA0BAIdgAA\nAAAaAsEOAAAAQEMg2AEAAABoCAQ7AAAAAA2BYAcAAACgIRDsAAAAADQEgh0AAACAhkCwAwAA\nANAQCHYAAAAAGgLBDgAAAEBDINgBAAAAaAgEOwAAAAANgWAHAAAAoCEQ7AAAAAA0BIIdAAAA\ngIZAsAMAAADQEAh2AAAAABoCwQ4AAABAQyDYAQAAAGgIBDsAAAAADYFgBwAAAKAhEOwAAAAA\nNASCHQAAAICGQLADAAAA0BAIdgAAAAAaAsEOAAAAQEMg2AEAAABoCAQ7AAAAAA2BYAcAAACg\nIRDsAAAAADQEgh0AAACAhkCwAwAAANAQCHYAAAAAGgLBDgDeLv/enz9+NbV3F3tLU0ORtkEr\nm459R0z6Ofj4fwq62szsy17UC+lSBSvVsqvw4Xeqd8B9f/LrE5TyPFMRn5lg5RqsGpdLHu3/\nZemogb3bWpnragm0dA2t29oPHPXphuBTRa+9z2/yTk4CANxF0TT+qQPAmyklW+Z8s